 struct TreeNode {
     int val;
     struct TreeNode *left;
     struct TreeNode *right;
 };
#include <stdio.h>
#include <string.h>
#include <stdlib.h>

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     struct TreeNode *left;
 *     struct TreeNode *right;
 * };
 */

#define BUF_SIZE (1 << 16)
/** Encodes a tree to a single string. */
char* serialize(struct TreeNode* root)
{
    struct TreeNode **buffer = (struct TreeNode **)malloc(sizeof(struct TreeNode *) * BUF_SIZE);
    int head = 0, tail = 0, offset = 0, i;
    char *result = (char *)malloc(BUF_SIZE);

    // push initial node
    buffer[tail++] = root;

    // queue
    for (; head < tail; head++) {
        if (buffer[head] == NULL) continue;
        buffer[tail++] = buffer[head]->left;
        buffer[tail++] = buffer[head]->right;
    }

    // remove trailing null
    while (buffer[tail - 1] == NULL) tail--;

    // serialize
    offset += snprintf(result, BUF_SIZE - offset, "[");
    for (i = 0; i < tail; i++) {
        if (i > 0) result[offset++] = ',';
        if (buffer[i] == NULL) {
            offset += snprintf(result + offset, BUF_SIZE - offset, "null"); 
        } else {
            offset += snprintf(result + offset, BUF_SIZE - offset, "%d", buffer[i]->val); 
        }
    }

    offset += snprintf(result + offset, BUF_SIZE - offset, "]");
    free(buffer);
    return result;
}


/** Decodes your encoded data to tree. */
struct TreeNode* deserialize(char* data)
{
    int offset, n = 0, head = 0, tail = 0;
    struct TreeNode **buffer = (struct TreeNode **)malloc(sizeof(struct TreeNode *) * BUF_SIZE);
    struct TreeNode *node;
    char *tmp;

    for (offset = 1; data[offset] != ']';) {
        switch (data[offset]) {
        case 'n':
            buffer[n++] = NULL;
            offset += 4;
            break;
        case '+':
        case '-':
        case '0':
        case '1':
        case '2':
        case '3':
        case '4':
        case '5':
        case '6':
        case '7':
        case '8':
        case '9':
            node = (struct TreeNode *)malloc(sizeof(struct TreeNode));
            node->val = strtol(data + offset, &tmp, 10);
            buffer[n++] = node;
            offset += tmp - (data + offset);
            break;
        case ',':
            offset++;
        case ']':
            break;
        }
    }

    for (head = 0, tail = head + 1; head < n;) {
        buffer[head]->left = ((tail < n) ? (buffer[tail++]) : NULL);
        buffer[head]->right = ((tail < n) ? (buffer[tail++]) : NULL);
        for (head += 1; buffer[head] == NULL; head++) ;
    }
    node = buffer[0];
    free(buffer);

    return node;
}

void pre_order_traversal(struct TreeNode *root)
{
    if (root == NULL) return;
    printf("%d\n", root->val);
    pre_order_traversal(root->left);
    pre_order_traversal(root->right);
}

void in_order_traversal(struct TreeNode *root)
{
    if (root == NULL) return;
    in_order_traversal(root->left);
    printf("%d\n", root->val);
    in_order_traversal(root->right);
}

void post_order_traversal(struct TreeNode *root)
{
    if (root == NULL) return;
    post_order_traversal(root->left);
    post_order_traversal(root->right);
    printf("%d\n", root->val);
}
